import React, { useState, useEffect } from 'react';
import { connect } from 'react-redux';
import { fetchPosts } from '../actions';

const PostList = ({ fetchPosts }) => {

    // componentDidMount equivalent
    useEffect(() => {
        fetchPosts();
    }, []);

    return (
        <div>Post list.</div>
    );
};

// const mapStateToProps = (state) => {
